import React from 'react';
import { View, Text, TextInput } from 'react-native';

const Estilos = StyleSheet.create({
  container: { padding: 10 },
});

const App = () => {
  return (
    <View style={Estilos.container}>
      <TextInput />

      <Text>***</Text>
    </View>
  );
};

export default App;
